import Button from './UI/Button';

const CustomerRow = props => {
  return (
    <>
      <tr>
        <td>{props.customerName}</td>
        <td>{props.customerEmail}</td>
      </tr>
      <Button />
    </>
  );
};

export default CustomerRow;
